import React from 'react'
function Login() {
  return (
    <div className=' h-screen bg-green-300 flex items-center justify-center'>
        <div className='w-[350px] p-6 '> /* login-container */
            <h1>Login </h1>
            <form>
         <div> /*input-group*/
                <label>Email</label>
                <input type='email' placeholder=''           className='items-center'/>
                </div>


                <div> /*input-group*/
                <label>Password</label>
                <input  placeholder="Enter password"className='items-center'/>
                </div>

                <button type='submit'>Login</button>
            <p> Don't have an account? 
                <a href='#'>Register</a>
            </p>
            </form>
        </div>
        </div>
  )
}

export default Login



